de jeunes footballeurs prometteurs. Tout un programme qui donne envie de sortir les crampons, vous ne trouvez pas ?</p>\n<!-- /wp:paragraph -->','','','inherit','closed','closed','','69-revision-v1','','','2019-12-16 10:34:28','2019-12-16 09:34:28','',69,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/69-revision-v1/',0,'revision','',0),(72,1,'2019-12-16 10:35:13','2019-12-16 09:35:13','<!-- wp:image {\"id\":70,\"width\":644,\"height\":323,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://192.168.33.10/evaluationwordpress/wp-content/uploads/2019/12/téléchargement-8.jpg\" alt=\"\" class=\"wp-image-70\" width=\"644\" height=\"323\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading -->\n<h2> </h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Les fêtes de fin d\'année approchent à grands pas. Et si vous les passiez sur les terrains virtuels de FIFA 20 ?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La simulation de football d\'EA Sports est de retour, plus réaliste que jamais grâce à la technologie Frostbite et tout un tas d\'améliorations inédites à l\'instar du&nbsp;<strong>FOOTBALL INTELLIGENT</strong>. Ce dernier s\'accompagne de stratégies et d\'actions uniques à réaliser sur le terrain (dribbles latéraux, tacles maîtrisés, nouvelles trajectoirs de tirs...).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Autre nouveauté incontournable de FIFA 20 :&nbsp;<strong>le mode VOLTA FOOTBALL</strong>&nbsp;qui met le foot de rue en avant. Dans la peau d\'un joueur créé de A à Z, enchaînez les tricks sur 17 playgrounds situés aux quatre coins du monde.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Evidemment,&nbsp;<strong>le mode FUT est lui aussi de la partie, avec de nouvelles façons de créer votre équipe de rêve</strong>. Sans oublier le mode Carrière qui vous glisse dans les bottes d\'un entraîneur bien décidé à remporter les coupes les plus prestigieuses de la planète avec une équipe de jeunes footballeurs prometteurs. Tout un programme qui donne envie de sortir les crampons, vous ne trouvez pas ?</p>\n<!-- /wp:paragraph -->','FIFA 20 : pour la beauté du sport !','','inherit','closed','closed','','69-revision-v1','','','2019-12-16 10:35:13','2019-12-16 09:35:13','',69,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/69-revision-v1/',0,'revision','',0),(73,1,'2019-12-16 10:35:26','2019-12-16 09:35:26','<!-- wp:paragraph -->\n<p>Bienvenue sur WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis commencez à écrire !</p>\n<!-- /wp:paragraph -->','Bonjour tout le monde !','','inherit','closed','closed','','1-revision-v1','','','2019-12-16 10:35:26','2019-12-16 09:35:26','',1,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/1-revision-v1/',0,'revision','',0),(74,1,'2019-12-16 10:37:38','2019-12-16 09:37:38','<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=G7JUi2tCDhM\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=G7JUi2tCDhM\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p>Les semaines s\'enchaînent sur GTA Online, mais ne se ressemblent pas. Cette fois-ci, il est l\'heure de reprendre notre rôle de grand bandit et de rejoindre notre ami singulier Lester Crest. Ce dernier a une nouvelle mission à nous confier... Le braquage du Casino de Los Santos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour régner sur les rues de Los Santos et s\'offrir de plus en plus de véhicules armés jusqu\'aux roues, les joueurs ont besoin d\'obtenir davantage d\'argent. C\'est pour cette raison d\'ailleurs, que&nbsp;<a href=\"http://www.jeuxvideo.com/informations/#100546\">Rockstar Games</a>&nbsp;publie en ce 12 décembre 2019 une toute nouvelle mise à jour majeure permettant aux joueurs avides de gloire de participer à un tout nouveau casse.&nbsp;<strong>Aujourd\'hui, il s\'agit du braquage bientôt légendaire du Diamond Casino &amp; Hotel.</strong>&nbsp;Pour ce faire, les bandits en herbe doivent rejoindre Lester Crest à Mirror Park. Ce dernier va vous proposer de faire une toute nouvelle acquisition, soit d\'acheter la nouvelle salle d\'arcade de Maze Bank Foreclosures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>En plus d\'être la couverture idéale pour préparer le casse du siècle, la salle d\'arcade de Maze Bank Foreclosures vous permet d\'accéder à 12 nouveaux mini-jeux</strong>&nbsp;comme La revanche des Badlands II, La chute du magicien, la saga Course-Poursuite ou encore un jeu sur Madame Nazar, la voyante et collectionneuse que l\'on retrouve dans le mode multijoueur de&nbsp;<a href=\"http://www.jeuxvideo.com/jeux/ps4/jeu-554036/\">Red Dead Redemption II</a>. Cette salle d\'arcade permet également de stocker des véhicules de fuite ou encore de vous entraîner à forcer des chambres fortes et à pirater des portes avec votre équipe. Et comme dans l\'histoire principale de&nbsp;<a href=\"http://www.jeuxvideo.com/jeux/playstation-4-ps4/00053083-grand-theft-auto-v.htm\">Grand Theft Auto V</a>, les joueurs devront également choisir une équipe solide ou non, en recrutant par exemple un chauffeur, un pirate et un braqueur, et en choisissant l\'angle d\'approche utilisé (furtif, rusé ou en force).</p>\n<!-- /wp:paragraph -->','GTA Online - Le Diamond Casino & Hotel est prêt à se faire dévaliser','','publish','open','open','','gta-online-le-diamond-casino-hotel-est-pret-a-se-faire-devaliser','','','2019-12-16 10:37:38','2019-12-16 09:37:38','',0,'http://192.168.33.10/evaluationwordpress/?p=74',0,'post','',0),(75,1,'2019-12-16 10:37:38','2019-12-16 09:37:38','<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=G7JUi2tCDhM\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=G7JUi2tCDhM\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p>Les semaines s\'enchaînent sur GTA Online, mais ne se ressemblent pas. Cette fois-ci, il est l\'heure de reprendre notre rôle de grand bandit et de rejoindre notre ami singulier Lester Crest. Ce dernier a une nouvelle mission à nous confier... Le braquage du Casino de Los Santos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour régner sur les rues de Los Santos et s\'offrir de plus en plus de véhicules armés jusqu\'aux roues, les joueurs ont besoin d\'obtenir davantage d\'argent. C\'est pour cette raison d\'ailleurs, que&nbsp;<a href=\"http://www.jeuxvideo.com/informations/#100546\">Rockstar Games</a>&nbsp;publie en ce 12 décembre 2019 une toute nouvelle mise à jour majeure permettant aux joueurs avides de gloire de participer à un tout nouveau casse.&nbsp;<strong>Aujourd\'hui, il s\'agit du braquage bientôt légendaire du Diamond Casino &amp; Hotel.</strong>&nbsp;Pour ce faire, les bandits en herbe doivent rejoindre Lester Crest à Mirror Park. Ce dernier va vous proposer de faire une toute nouvelle acquisition, soit d\'acheter la nouvelle salle d\'arcade de Maze Bank Foreclosures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>En plus d\'être la couverture idéale pour préparer le casse du siècle, la salle d\'arcade de Maze Bank Foreclosures vous permet d\'accéder à 12 nouveaux mini-jeux</strong>&nbsp;comme La revanche des Badlands II, La chute du magicien, la saga Course-Poursuite ou encore un jeu sur Madame Nazar, la voyante et collectionneuse que l\'on retrouve dans le mode multijoueur de&nbsp;<a href=\"http://www.jeuxvideo.com/jeux/ps4/jeu-554036/\">Red Dead Redemption II</a>. Cette salle d\'arcade permet également de stocker des véhicules de fuite ou encore de vous entraîner à forcer des chambres fortes et à pirater des portes avec votre équipe. Et comme dans l\'histoire principale de&nbsp;<a href=\"http://www.jeuxvideo.com/jeux/playstation-4-ps4/00053083-grand-theft-auto-v.htm\">Grand Theft Auto V</a>, les joueurs devront également choisir une équipe solide ou non, en recrutant par exemple un chauffeur, un pirate et un braqueur, et en choisissant l\'angle d\'approche utilisé (furtif, rusé ou en force).</p>\n<!-- /wp:paragraph -->','GTA Online - Le Diamond Casino & Hotel est prêt à se faire dévaliser','','inherit','closed','closed','','74-revision-v1','','','2019-12-16 10:37:38','2019-12-16 09:37:38','',74,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/74-revision-v1/',0,'revision','',0),(76,1,'2019-12-16 10:39:27','2019-12-16 09:39:27','<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=LuO9FOM4NSg\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=LuO9FOM4NSg\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p>Comme l\'avait promis Epic Games aux Game Awards, les joueurs ont bien pu découvrir un événement Star Wars, centré autour d\'un extrait de L\'Ascension des Skywalker, nouvel opus de la franchise de Disney.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Outre l\'apparition de skins spéciaux (avec notamment celui de Finn et de Rey), Epic Games a également mis à disposition gratuitement et pour toujours un vaisseau spatial issu de la saga, à quiconque se connectait dans le mode spécialement dédié à l\'event, entre 19h30 et 20h10. Le lobby profitait également d\'une animation, on passait alors en hyper-espace pour se connecter au serveur, puis la musique de Star Wars retentissait en arrière-fond.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Au final, c\'est donc&nbsp;<strong>un extrait du film</strong>, attendu pour le 18 décembre en France, qui a été diffusé en live, et&nbsp;<strong>suivi sur Twitch par plus de 800 000 spectateurs</strong>, avec également une petite session de questions/réponses. Le tout, présenté par J.J. Abrams, qui était présent dans les locaux d\'Epic, et en live.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour célébrer cet événement, Epic Games propose par ailleurs un week-end double-XP.</p>\n<!-- /wp:paragraph -->','Fortnite : découvrez l\'événement Star Wars 9 en vidéo','','publish','open','open','','fortnite-decouvrez-levenement-star-wars-9-en-video','','','2019-12-16 10:39:27','2019-12-16 09:39:27','',0,'http://192.168.33.10/evaluationwordpress/?p=76',0,'post','',0),(77,1,'2019-12-16 10:39:27','2019-12-16 09:39:27','<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=LuO9FOM4NSg\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=LuO9FOM4NSg\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p>Comme l\'avait promis Epic Games aux Game Awards, les joueurs ont bien pu découvrir un événement Star Wars, centré autour d\'un extrait de L\'Ascension des Skywalker, nouvel opus de la franchise de Disney.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Outre l\'apparition de skins spéciaux (avec notamment celui de Finn et de Rey), Epic Games a également mis à disposition gratuitement et pour toujours un vaisseau spatial issu de la saga, à quiconque se connectait dans le mode spécialement dédié à l\'event, entre 19h30 et 20h10. Le lobby profitait également d\'une animation, on passait alors en hyper-espace pour se connecter au serveur, puis la musique de Star Wars retentissait en arrière-fond.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Au final, c\'est donc&nbsp;<strong>un extrait du film</strong>, attendu pour le 18 décembre en France, qui a été diffusé en live, et&nbsp;<strong>suivi sur Twitch par plus de 800 000 spectateurs</strong>, avec également une petite session de questions/réponses. Le tout, présenté par J.J. Abrams, qui était présent dans les locaux d\'Epic, et en live.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour célébrer cet événement, Epic Games propose par ailleurs un week-end double-XP.</p>\n<!-- /wp:paragraph -->','Fortnite : découvrez l\'événement Star Wars 9 en vidéo','','inherit','closed','closed','','76-revision-v1','','','2019-12-16 10:39:27','2019-12-16 09:39:27','',76,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/76-revision-v1/',0,'revision','',0),(78,1,'2019-12-16 10:41:22','2019-12-16 09:41:22','{\n    \"page_on_front\": {\n        \"value\": \"42\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-12-16 09:41:22\"\n    }\n}','','','trash','closed','closed','','6a714bb1-77db-4ac4-9b2c-728430002559','','','2019-12-16 10:41:22','2019-12-16 09:41:22','',0,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/6a714bb1-77db-4ac4-9b2c-728430002559/',0,'customize_changeset','',0),(79,1,'2019-12-16 10:43:26','2019-12-16 09:43:26','','Contact','','inherit','closed','closed','','18-revision-v1','','','2019-12-16 10:43:26','2019-12-16 09:43:26','',18,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/18-revision-v1/',0,'revision','',0),(80,1,'2019-12-16 10:44:41','2019-12-16 09:44:41','<label> Votre nom (obligatoire)\n    [text* your-name] </label>\n\n<la