0),(82,1,'2019-12-16 10:47:09','2019-12-16 09:47:09','<!-- wp:paragraph -->\n<p>[contact-form-7 id=\"81\" title=\"Formulaire de Contact\"]</p>\n<!-- /wp:paragraph -->','Formulaire de Contact','','trash','closed','closed','','formulaire-de-contact__trashed','','','2019-12-16 10:53:38','2019-12-16 09:53:38','',0,'http://192.168.33.10/evaluationwordpress/?page_id=82',0,'page','',0),(83,1,'2019-12-16 10:47:09','2019-12-16 09:47:09','<!-- wp:paragraph -->\n<p>[contact-form-7 id=\"81\" title=\"Formulaire de Contact\"]</p>\n<!-- /wp:paragraph -->','Formulaire de Contact','','inherit','closed','closed','','82-revision-v1','','','2019-12-16 10:47:09','2019-12-16 09:47:09','',82,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/82-revision-v1/',0,'revision','',0),(84,1,'2019-12-16 10:53:29','2019-12-16 09:53:29','<!-- wp:paragraph -->\n<p>[contact-form-7 id=\"81\" title=\"Formulaire de Contact\"]</p>\n<!-- /wp:paragraph -->','Contact','','inherit','closed','closed','','18-revision-v1','','','2019-12-16 10:53:29','2019-12-16 09:53:29','',18,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/18-revision-v1/',0,'revision','',0),(85,1,'2019-12-16 10:54:47','2019-12-16 09:54:47','<!-- wp:paragraph -->\n<p>Ceci est une page d’exemple. C’est différent d’un article de blog parce qu’elle restera au même endroit et apparaîtra dans la navigation de votre site (dans la plupart des thèmes). La plupart des gens commencent par une page « À propos » qui les présente aux visiteurs du site. Cela pourrait ressembler à quelque chose comme cela :</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Bonjour ! Je suis un mécanicien qui aspire à devenir acteur, et voici mon site. J’habite à Bordeaux, j’ai un super chien baptisé Russell, et j’aime la vodka-ananas (ainsi qu’être surpris par la pluie soudaine lors de longues balades sur la plage au coucher du soleil).</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>... ou quelque chose comme cela :</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>La société 123 Machin Truc a été créée en 1971, et n’a cessé de proposer au public des machins-trucs de qualité depuis lors. Située à Saint-Remy-en-Bouzemont-Saint-Genest-et-Isson, 123 Machin Truc emploie 2 000 personnes, et fabrique toutes sortes de bidules super pour la communauté bouzemontoise.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>En tant que nouvel·le utilisateur ou utilisatrice de WordPress, vous devriez vous rendre sur <a href=\"http://192.168.33.10/evaluationwordpress/wp-admin/\">votre tableau de bord</a> pour supprimer cette page et créer de nouvelles pages pour votre contenu. Amusez-vous bien !</p>\n<!-- /wp:paragraph -->','Page d’exemple','','inherit','closed','closed','','2-revision-v1','','','2019-12-16 10:54:47','2019-12-16 09:54:47','',2,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/2-revision-v1/',0,'revision','',0),(86,1,'2019-12-16 10:54:51','2019-12-16 09:54:51','<!-- wp:heading --><h2>Qui sommes-nous ?</h2><!-- /wp:heading --><!-- wp:paragraph --><p>L’adresse de notre site Web est : http://192.168.33.10/evaluationwordpress.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Utilisation des données personnelles collectées</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Commentaires</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Quand vous laissez un commentaire sur notre site web, les données inscrites dans le formulaire de commentaire, mais aussi votre adresse IP et l’agent utilisateur de votre navigateur sont collectés pour nous aider à la détection des commentaires indésirables.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Une chaîne anonymisée créée à partir de votre adresse de messagerie (également appelée hash) peut être envoyée au service Gravatar pour vérifier si vous utilisez ce dernier. Les clauses de confidentialité du service Gravatar sont disponibles ici : https://automattic.com/privacy/. Après validation de votre commentaire, votre photo de profil sera visible publiquement à coté de votre commentaire.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Médias</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous êtes un utilisateur ou une utilisatrice enregistré·e et que vous téléversez des images sur le site web, nous vous conseillons d’éviter de téléverser des images contenant des données EXIF de coordonnées GPS. Les visiteurs de votre site web peuvent télécharger et extraire des données de localisation depuis ces images.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Formulaires de contact</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous déposez un commentaire sur notre site, il vous sera proposé d’enregistrer votre nom, adresse de messagerie et site web dans des cookies. C’est uniquement pour votre confort afin de ne pas avoir à saisir ces informations si vous déposez un autre commentaire plus tard. Ces cookies expirent au bout d’un an.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si vous vous rendez sur la page de connexion, un cookie temporaire sera créé afin de déterminer si votre navigateur accepte les cookies. Il ne contient pas de données personnelles et sera supprimé automatiquement à la fermeture de votre navigateur.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Lorsque vous vous connecterez, nous mettrons en place un certain nombre de cookies pour enregistrer vos informations de connexion et vos préférences d’écran. La durée de vie d’un cookie de connexion est de deux jours, celle d’un cookie d’option d’écran est d’un an. Si vous cochez « Se souvenir de moi », votre cookie de connexion sera conservé pendant deux semaines. Si vous vous déconnectez de votre compte, le cookie de connexion sera effacé.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>En modifiant ou en publiant une publication, un cookie supplémentaire sera enregistré dans votre navigateur. Ce cookie ne comprend aucune donnée personnelle. Il indique simplement l’ID de la publication que vous venez de modifier. Il expire au bout d’un jour.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contenu embarqué depuis d’autres sites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Les articles de ce site peuvent inclure des contenus intégrés (par exemple des vidéos, images, articles…). Le contenu intégré depuis d’autres sites se comporte de la même manière que si le visiteur se rendait sur cet autre site.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Ces sites web pourraient collecter des données sur vous, utiliser des cookies, embarquer des outils de suivis tiers, suivre vos interactions avec ces contenus embarqués si vous disposez d’un compte connecté sur leur site web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Statistiques et mesures d’audience</h3><!-- /wp:heading --><!-- wp:heading --><h2>Utilisation et transmission de vos données personnelles</h2><!-- /wp:heading --><!-- wp:heading --><h2>Durées de stockage de vos données</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous laissez un commentaire, le commentaire et ses métadonnées sont conservés indéfiniment. Cela permet de reconnaître et approuver automatiquement les commentaires suivants au lieu de les laisser dans la file de modération.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Pour les utilisateurs et utilisatrices qui s’enregistrent sur notre site (si cela est possible), nous stockons également les données personnelles indiquées dans leur profil. Tous les utilisateurs et utilisatrices peuvent voir, modifier ou supprimer leurs informations personnelles à tout moment (à l’exception de leur nom d’utilisateur·ice). Les gestionnaires du site peuvent aussi voir et modifier ces informations.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Les droits que vous avez sur vos données</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous avez un compte ou si vous avez laissé des commentaires sur le site, vous pouvez demander à recevoir un fichier contenant toutes les données personnelles que nous possédons à votre sujet, incluant celles que vous nous avez fournies. Vous pouvez également demander la suppression des données personnelles vous concernant. Cela ne prend pas en compte les données stockées à des fins administratives, légales ou pour des raisons de sécurité.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Transmission de vos données personnelles</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Les commentaires des visiteurs peuvent être vérifiés à l’aide d’un service automatisé de détection des commentaires indésirables.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Informations de contact</h2><!-- /wp:heading --><!-- wp:heading --><h2>Informations supplémentaires</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comment nous protégeons vos données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Procédures mises en œuvre en cas de fuite de données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Les services tiers qui nous transmettent des données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Opérations de marketing automatisé et/ou de profilage réalisées à l’aide des données personnelles</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Affichage des informations liées aux secteurs soumis à des régulations spécifiques</h3><!-- /wp:heading -->','Politique de confidentialité','','inherit','closed','closed','','3-revision-v1','','','2019-12-16 10:54:51','2019-12-16 09:54:51','',3,'http://192.168.33.10/evaluationwordpress/index.php/2019/12/16/3-revision-v1/',0,'revision','',0),(87,1,'2019-12-16 11:03:16','2019-12-16 10:03:16','','NBA 2K20 PS4','NBA 2K est devenu bien plus qu\'une simulation de basket. 2K continue de redéfinir les limites des jeux de sport avec NBA 2K20, son gameplay, ses graphismes, ses modes de jeu, un contrôle des joueurs et des options de personnalisation révolutionnaires. De plus, grâce à son monde ouvert immersif, NBA 2K20 est une plateforme où se rassemblent les amoureux du ballon, réels comme virtuels, afin de créer la culture du basket de demain.','publish','open','closed','','nba-2k20-ps4','','','2019-12-16 11:03:16','2019-12-16 10:03:16','',0,'http://192.168.33.10/evaluationwordpress/?post_type=product&#038;p=87',0,'product','',0),(88,1,'2019-12-16 11:01:00','2019-12-16 10:01:00','','99592','','inherit','open','closed','','99592','','','2019-12-16 11:01:00','2019-12-16 10:01:00','',87,'http://192.168.33.10/evaluationwordpress/wp-content/uploads/2019/12/99592.jpg',0,'attachment','image/jpeg',0),(89,1,'2019-12-16 11:06:12','2019-12-16 10:06:12','','FIFA 20 PS4','Doté du moteur Frostbite™, EA SPORTS™ FIFA 20 sur PlayStation®4, Xbox One et PC vous propose deux facettes du Jeu Universel : le prestige du football professionnel et une nouvelle expérience réaliste de street football avec EA SPORTS VOLTA. FIFA 20 innove sur tous les plans : le FOOTBALL INTELLIGENT vous offre un réalisme sans précédent, FIFA Ultimate Team™ vous propose de nouvelles façons de créer votre équipe de rêve et EA SPORTS VOLTA vous plonge dans le monde du street avec des terrains réduits.','publish','open','closed','','fifa-20-ps4','','','2019-12-16 11:06:13','2019-12-16 10:06:13','',0,'http://192.168.33.10/evaluationwordpress/?post_type=product&#038;p=89',0,'product','',0),(90,1,'2019-12-16 11:04:58','2019-12-16 10:04:58','','98915','','inherit','open','closed','','98915','','','2019-12-16 11:04:58','2019-12-16 10:04:58','',89,'http://192.168.33.10/evaluationwordpress/wp-content/uploads/2019/12/98915.jpg',0,'attachment','image/jpeg',0),(91,1,'2019-12-16 11:09:50','2019-12-16 10:09:50','Une tonne de nouveau contenu attend également les anciens joueurs des versions PlayStation®3 et Xbox 360, et notamment des versions rares de véhicules classiques de l\'univers de Grand Theft Auto, comme la Dukes, l\'hydravion Dodo et un dirigeable encore plus rapide et plus facile à piloter. Sans oublier de nouvelles activités dont la photographique de la faune et la flore, de nouveaux défis au stand de tir, de nouvelles armes et plus encore.\r\n\r\n<strong><em>Grand Theft Auto V</em></strong> exploite les capacités des systèmes de nouvelle génération pour intégrer des améliorations : résolution supérieure, graphismes plus détaillés, trafic plus dense, profondeur de champ accrue, Intelligence Artificielle améliorée, nouveaux animaux, effets climatiques et animations de dégâts avancées...\r\n\r\n<strong><em>Grand Theft Auto V</em></strong> inclut <strong><em>Grand Theft Auto Online</em></strong>, l\'univers en ligne de Grand Theft Auto. Explorez le vaste monde ou consacrez tous vos efforts à votre carrière criminelle en rejoignant un crew pour terminer des missions et gagner de l\'argent. Achetez des appartements, des véhicules et des améliorations pour votre personnage, affrontez d\'autres joueurs dans des modes de jeu compétitifs classiques et créez du nouveau contenu à partager avec l\'ensemble de la communauté.\r\n\r\nTout le contenu créé et publié depuis le lancement de <strong><em>Grand Theft Auto Online</em></strong> (y compris les activités, les armes, les véhicules, les appartements et les options de personnalisation) est disponible. De plus, la communauté de joueurs actuelle a la possibilité de transférer ses personnages et sa progression dans <strong><em>Grand Theft Auto Online</em></strong> sur PlayStation 4, Xbox One ou PC.\r\n\r\n<strong>Rappel du scénario :</strong>\r\n\r\nLos Santos : une métropole tentaculaire avec ses gourous, ses starlettes et ses célébrités déchues qui faisait jadis rêver le monde entier, mais qui lutte à présent pour ne pas sombrer dans l\'oubli alors que le pays est rongé par la crise et la téléréalité bas de gamme. Au milieu de ce chaos ensoleillé, trois criminels très différents vont risquer le tout pour le tout dans une série de braquages aussi spectaculaires que dangereux.\r\n\r\n<strong>Les joueurs vont découvrir un ensemble d’ajouts et d’améliorations comprenant :</strong>\r\n\r\n- Nouvelles armes, véhicules et activités\r\n- Nouvelle faune et flore\r\n- Circulation plus dense\r\n- Nouveau système de végétation\r\n- Effets de dégâts et de météo plus persistants, et bien plus encore','GTA V XBOX ONE','','publish','open','closed','','gta-v-xbox-one','','','2019-12-16 11:09:51','2019-12-16 10:09:51','',0,'http://192.168.33.10/evaluationwordpress/?post_type=product&#038;p=91',0,'product','',0),(92,1,'2019-12-16 11:07:36','2019-12-16 10:07:36','','57094','','inherit','open','closed','','57094','','','2019-12-16 11:07:36','2019-12-16 10:07:36','',91,'http://192.168.33.10/evaluationwordpress/wp-content/uploads/2019/12/57094.jpg',0,'attachment','image/jpeg',0),(93,1,'2019-12-16 11:13:49','2019-12-16 10:13:49','','SOLDES','','publish','closed','closed','','soldes','','','2019-12-16 11:13:49','2019-12-16 10:13:49','',0,'http://192.168.33.10/evaluationwordpress/?post_type=shop_coupon&#038;p=93',0,'shop_coupon','',0),(94,1,'2019-12-16 11:17:33','2019-12-16 10:17:33','{\n    \"expert-carpenter::background_image\": {\n        \"value\": \"http://192.168.33.10/evaluationwordpress/wp-content/uploads/2019/12/Z6B4FG2K2EILZ64LHBWMIFI4WA.jpg\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-12-16 10:16:28\"\n    },\n    \"expert-carpenter::header_image\": {\n        \"value\": \"remove-header\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-12-16 10:17:28\"\n    },\n    \"expert-carpenter::header_image_data\": {\n        \"value\": \"remove-header\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-12-16 10:17:28\"\n    }\n}','','','trash','closed','closed','','d0108f3f-06f6-4533-82b9-da829a6d8559','','','2019-12-16 11:17:33','2019-12-16 10